// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@uniswap/v3-core/contracts/interfaces/IUniswapV3Pool.sol";
import "@uniswap/v3-periphery/contracts/interfaces/ISwapRouter.sol";
import "@uniswap/v3-core/contracts/interfaces/IUniswapV3Factory.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

contract ArbitrageBot {
    using SafeERC20 for IERC20;

    ISwapRouter public swapRouter;
    IUniswapV3Factory public swapFactory;
    address public owner;
    uint24 public lowFeeTier;
    uint24 public highFeeTier;
    IERC20 public tokenIn;
    IERC20 public tokenOut;

    constructor(
        IERC20 _tokenIn,
        IERC20 _tokenOut,
        uint24 _lowFeeTier,
        uint24 _highFeeTier,
        address _swapRouterAddress,
        address _swapFactory
    ) {
        tokenIn = _tokenIn;
        tokenOut = _tokenOut;
        lowFeeTier = _lowFeeTier;
        highFeeTier = _highFeeTier;
        swapRouter = ISwapRouter(_swapRouterAddress);
        swapFactory = IUniswapV3Factory(_swapFactory);
        owner = msg.sender;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Only the owner can call this function");
        _;
    }

    function executeArbitrage(uint256 amountIn) external onlyOwner {
        // Step 1: Check the price difference between the two fee tiers
        uint256 priceLowFee = getEthPrice(lowFeeTier);
        uint256 priceHighFee = getEthPrice(highFeeTier);

        // Arbitrage is profitable if priceLowFee is significantly lower than priceHighFee
        if (priceLowFee < priceHighFee) {
            // Step 2: Perform the arbitrage
            uint256 amountOut = swapBetweenFeeTiers(lowFeeTier, highFeeTier, amountIn);

            // Step 3: Transfer the proceeds to the contract owner
            tokenOut.safeTransfer(owner, amountOut);
        }
    }

    function getEthPrice(uint24 feeTier) internal view returns (uint256) {
        IUniswapV3Pool pool = IUniswapV3Pool(
            IUniswapV3Factory(swapFactory).getPool(address(tokenIn), address(tokenOut), feeTier)
        );
        (uint160 sqrtPriceX96, , , , , , ) = pool.slot0();
        return sqrtPriceX96 * sqrtPriceX96 * 1e18 / (2**96);
    }

    function swapBetweenFeeTiers(uint24 feeTier1, uint24 feeTier2, uint256 amountIn)
        internal
        returns (uint256 amountOut)
    {
        // Swap from feeTier1 to feeTier2
        swapRouter.exactInputSingle(
            ISwapRouter.ExactInputSingleParams({
                tokenIn: address(tokenIn),
                tokenOut: address(tokenOut),
                fee: feeTier1,
                recipient: address(this),
                deadline: block.timestamp + 300,
                amountIn: amountIn,
                amountOutMinimum: 0,
                sqrtPriceLimitX96: 0
            })
        );

        // Calculate the amount received after the first swap
        amountOut = tokenOut.balanceOf(address(this));

        // Swap back from feeTier2 to feeTier1
        swapRouter.exactInputSingle(
            ISwapRouter.ExactInputSingleParams({
                tokenIn: address(tokenOut),
                tokenOut: address(tokenIn),
                fee: feeTier2,
                recipient: address(this),
                deadline: block.timestamp + 300,
                amountIn: amountOut,
                amountOutMinimum: 0,
                sqrtPriceLimitX96: 0
            })
        );

        // Calculate the fees incurred during the second swap
        uint256 fees = tokenIn.balanceOf(address(this));

        // Calculate the final amountOut after fees
        amountOut = amountOut - fees;

        return amountOut;
    }
}

